Có thể sử dụng các chương trình đọc tệp như fstream hoặc ifstream để đọc vào một tệp văn bản. Các chương trình này có thể sử dụng một câu lệnh chú ý để chỉ ra các dòng văn bản có thể quan tâm. Ví dụ:

```cpp
#include <fstream>
#include <string>

int main() {
    // Open the file and point the stream pointer to it.
    std::ifstream file("filename.txt");

    // Read the contents of the file line by line.
    while (file) {
        // Get a line of text from the file.
        std::string line;
        getline(file, line);

        // Check if the line contains the target word.
        if (line.find("word") != std::string::npos) {
            // Count the number of times the word appears in the file.
            int count = 0;
            for (const auto& character : line) {
                if (character == ' ') { // Ignore spaces in between words.
                    count++;
                } else { // Count only non-space characters.
                    count++;
                }
            }
            std::cout << "The word \"" << line << "\" appears " << count << " times." << std::endl;
        } else { // Not found, ignore this line and move to next one.
            file >> std::skipws; // Skip whitespace characters to keep reading next line.
        }
    }
}

